from fastapi import FastAPI, HTTPException
from pydantic import BaseModel
from typing import List

app = FastAPI()

class Subscription(BaseModel):
    subscription_id: str
    customer_id: str
    start_date: str
    end_date: str
    subscription_type: str

subscriptions = []

@app.post("/subscriptions/", response_model=Subscription)
def create_subscription(subscription: Subscription):
    if subscription.subscription_type in ["monthly", "yearly"]:
        subscription.end_date = subscription.start_date + "T" + "01:00:00Z"
    else:
        raise HTTPException(status_code=400, detail="Invalid subscription type")
    subscriptions.append(subscription)
    return subscription

@app.get("/subscriptions/{subscription_id}", response_model=Subscription)
def get_subscription(subscription_id: str):
    for subscription in subscriptions:
        if subscription.subscription_id == subscription_id:
            return subscription
    raise HTTPException(status_code=404, detail="Subscription not found")

@app.put("/subscriptions/{subscription_id}", response_model=Subscription)
def update_subscription(subscription_id: str, updated_subscription: Subscription):
    for subscription in subscriptions:
        if subscription.subscription_id == subscription_id:
            subscription.start_date = updated_subscription.start_date
            subscription.end_date = updated_subscription.end_date
            subscription.subscription_type = updated_subscription.subscription_type
            return subscription
    raise HTTPException(status_code=404, detail="Subscription not found")

@app.delete("/subscriptions/{subscription_id}")
def delete_subscription(subscription_id: str):
    for index, subscription in enumerate(subscriptions):
        if subscription.subscription_id == subscription_id:
            del subscriptions[index]
            return {"message": "Subscription deleted successfully"}
    raise HTTPException(status_code=404, detail="Subscription not found")

@app.get("/subscriptions/", response_model=List[Subscription])
def get_subscriptions():
