["Sure, here's an example of a kernel that operates over a vector for FPGA using oneAPI and SYCL.

Let's say we want to implement a simple kernel that adds two vectors of integers. Here are the three files:

1. `main.cpp`: This file contains the main program that launches the kernel.
```cpp
#include <sycl.h>
#include <sycl_int.h>

int main() {
    // Create a sycl context
    sycl::context context;

    // Create a sycl device
    sycl::device device(context);

    // Create a sycl queue
    sycl::queue queue(device);

    // Define the kernel
    sycl::kernel kernel("add_vectors", sycl::access::read_write, sycl::range<2>{10, 10});

    // Set the input vectors
    sycl::buffer<int, 1> input_vector1(queue, sycl::range<2>{10, 10});
    sycl::buffer<int, 1> input_vector2(queue, sycl::range<2>{10, 10});

    // Launch the kernel
    queue.submit([&](sycl::handler& h) {
        h.store(input_vector1, kernel);
        h.store(input_vector2, kernel);
        h.call(kernel);
    });

    return 0;
}
